import React from "react";

export const Pelis = ({ pelis }) => {
  console.log(pelis);
  console.log(pelis && pelis.Title);

  return (
    <>
      <ul>
        {pelis &&
          pelis.map((peli) => {
            return (
              <li key={peli.imdbID}>
                <h1>{peli.Title}</h1>
                <img src={peli && peli.Poster} />
                <h3>{peli.Year}</h3>
              </li>
            );
          })}
      </ul>
    </>
  );
};
